import React from 'react'
import './App.css'
import Home from './Pages/Home'
import Blog from './Pages/Blog'
import {Route, Routes} from 'react-router-dom'



const App = () => {
  return (
    <div>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/blog/:id" element={<Blog />} />
      </Routes>
    </div>
  )
}

export default App;
